// styleing start


import  "./frontEndStyleing/css/font-awesome.css";
// import "./frontEndStyleing/css/bootstrap.css";
// import "./frontEndStyleing/css/jquery.smartmenus.bootstrap.css";
// import  "./frontEndStyleing/css/jquery.simpleLens.css";
// import "./frontEndStyleing/css/slick.css";
// import "./frontEndStyleing/css/nouislider.css";
// import "./frontEndStyleing/css/theme-color/default-theme.css";
// import "./frontEndStyleing/css/sequence-theme.modern-slide-in.css";
import "./frontEndStyleing/css/style.css";

// import "https://ajax.googleapis.com/ajax/libs/jquery/1.11.3/jquery.min.js";
// import "../../public/assets/js/bootstrap.min.js";  
// import "../../public/assets/js/jquery.smartmenus.js";
// import  "smartmenus-bootstrap";
// import "../../public/assets/js/jquery.simpleGallery.js";
// import "../../public/assets/js/jquery.simpleLens.js";
// import "../../public/assets/js/slick.js";
// import "../../public/assets/js/nouislider.js";
// import "../../public/assets/js/custom.js"; 
// import  "https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js"

// import "https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.14.3/umd/popper.min.js";
// end styleing 

import React,{Component} from 'react';
import MyAccount from './MyAccount';
import Wishlist from './Wishlist';
import MyCart from './MyCart';
import Checkout from './Checkout';
import Login from './Login';
import Home from './Home/Home';
import Sports from './Sports/Sports';
import Furniture from './Furniture/Furniture';
import Blog from './Blog/Blog';
import Contact from './Contact/Contact';
import Footer from './Footer';
// Men routes
import Caual from './Men/Caual';
import Formal from './Men/Formal';
import Jeans from './Men/Jeans';
import Loafers from './Men/Loafers';
import Sandels from './Men/Sandels';
import Shirts from './Men/Shirts';
import Sleepwere from './Men/Sleepwere';
import MSports from './Men/MSports';
import Standard from './Men/Standrad';
import Tshirts from './Men/Tshirts';
import Trousers from './Men/Trousers';
import MJacket from './Men/MJacket'
//End Men routea

// Women routes
import WCaual from './Women/WCasual';
import WDisabledItem from './Women/WDisabledItem';
import WEarrings from './Women/WEarrings';
import WFormal from './Women/WFormal';
import WHairCare from './Women/WHairCare';
import WHandBags from './Women/WHandBags';
import WJackets from './Women/WJackets';
import WJeans from './Women/WJeans';
import WJewellerySets from './Women/WJewellerySets';
import WKurtaKurti from './Women/WKurtaKurti';
import WLockets from './Women/WLockets';
import WMakeUp from './Women/WMakeUp';
import WNail from './Women/WNail';
import WPerfumes from './Women/WPerfumes';
import WPoloTshirt from './Women/WPoloTshirt';
import WRings from './Women/WRings';
import WSarees from './Women/WSarees';
import WShoes from './Women/WShoes';
import WSingleBags from './Women/WSingleBags';
import WSkinCare from './Women/WSkinCare';
import WSkirts from './Women/WSkirts';
import WSports from './Women/WSports';
import WSunglases from './Women/WSunglases';
import WTops from './Women/WTops';
import WTravelBags from './Women/WTravelBags';
import WTrousers from './Women/WTrousers';
import WWalletsAndBelts from './Women/WWalletsAndBelts';

//End Women routes

// Kids routes

import KCasual from './Kids/KCasual';
import KFormal from './Kids/KFormal';
import KJeans from './Kids/KJeans';
import KLoafers from './Kids/KLoafers';
import KSandals from './Kids/KSandals';
import KShirts from './Kids/KShirts';
import KSports from './Kids/KSports';
import KStandard from './Kids/KStandard';
import KTrousers from './Kids/KTrousers';
import KTShirt from './Kids/KTShirt';

//End Kids routes

// Digital Route

import Accesories from './Digital/Accesories';
import Camera from './Digital/Camera';
import Laptop from './Digital/Laptop';
import Mobile from './Digital/Mobile';
import Tablet from './Digital/Tablet';

// End Digital Route

// Start pages  ->

import Page404 from './Pages/Page404';
import ShopPage from './Pages/ShopPage';
import ShopSingle from './Pages/ShopSingle';

// End pages    -> 


import {BrowserRouter as Router,Link,Route} from  'react-router-dom';
// images importing
import KSleepWare from './Kids/KSleepWare';
import Headers from './Headers';

import './style.css';
const Index = () =>
		        <Router>
                    <div className="container-fluid" style={{marginTop:"50px"}} >
                              <Headers />
                            <Route path='/myaccount' component={render=><MyAccount />} />
                            <Route path='/wishlist' component={render=><Wishlist />} />
                            <Route path='http://localhost:3000/myCart' component={render=><MyCart />} />
                            <Route path='/checkout' component={render=><Checkout />} />
                            <Route path='/login' component={render=><Login />} />
                            <Route exact path="/" component={render=><Home />} />
                            <Route path="/men" render={Men} />
                            <Route path="/women" component={Women} />
                            <Route path="/kids"  component={Kids} />
                            <Route path="/sports"  component={render=><Sports />} />
                            <Route path="/digital"  component={Digital} />
                            <Route path="/furniture"  component={render=><Furniture />} />
                            <Route path="/blog"  component={render=><Blog />} />
                            <Route path="/contact" component={render=><Contact />} />
                            <Route path="/pages"  component={Pages} />

                <hr />
                <Footer />
                    </div>
                </Router>

// Men Routes                
const Men =({match})=>{
    return(
            <div>
                <Router>

                    <div className="container">
                         <nav className="container-fluid" style={{marginTop:"80px"}}>
                            <div className="row" >
                                <div className="col-sm-4 col-md-4  col-lg-4  col-xl-4 col-4"  style={{paddingBottom:"10px",paddingBlockStart:"1px"}} >
                                    <Link to={`${match.url}/caual`} className="hovereffect" >
                                         <img src="data:image/jpeg;base64," title="Caual" alt="Caual"  width="300" height="200"   />
                                    </Link>
                                </div>
                                <div className="col-sm-4 col-md-4  col-lg-4  col-xl-4 col-4"  style={{paddingBottom:"10px",paddingBlockStart:"1px"}} >
                                    <Link to={`${match.url}/formal`} className="hovereffect">
                                     <img src="https://cdn.connor.com.au/media/catalog/category/CO0334-AW19-MobileCategoryBanners-Suits.jpg" title="Formal" alt="Formal" width="300" height="200"    />
                                    </Link>

                                </div>   
                                <div className="col-sm-4 col-md-4  col-lg-4  col-xl-4 col-4"  style={{paddingBottom:"10px",paddingBlockStart:"1px"}} >
                                    <Link to={`${match.url}/jeans`}  className="hovereffect">
                                     <img src="data:image/jpeg;base64," title="Jeans" alt="Jeans"  width="300" height="200"   />
                                    </Link>
                                </div>   
                                <div className="col-sm-4 col-md-4  col-lg-4  col-xl-4 col-4"  style={{paddingBottom:"10px",paddingBlockStart:"1px"}} >
                                    <Link to={`${match.url}/shirts`} className="hovereffect">
                                        <img src="https://ae01.alicdn.com/kf/HTB1leLgLVXXXXc2XVXXq6xXFXXXI/Mens-Fashion-Designer-Cross-Line-Slim-Fit-Dress-man-Shirts-Tops-Western-Casual-Brand-casual-V.jpg" title="Shirts" alt="shirts" width="300" height="200"   />
                                    </Link>
                                </div>   
                                <div className="col-sm-4 col-md-4  col-lg-4  col-xl-4 col-4"  style={{paddingBottom:"10px",paddingBlockStart:"1px"}} >
                                    <Link to={`${match.url}/sports`}  className="hovereffect">
                                        <img src="https://images.unsplash.com/photo-1533107862482-0e6974b06ec4?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60" title="Shirts" alt="shirts" width="300" height="200"   />
                                    </Link>

                                </div>   
                                <div className="col-sm-4 col-md-4  col-lg-4  col-xl-4 col-4"  style={{paddingBottom:"10px",paddingBlockStart:"1px"}} >
                                     <Link to={`${match.url}/standard`}  className="hovereffect">
                                        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSig5cb6BqJE1YvX_c8SQ8wnFm9j-5HZ1F4cAc1SMZ5-T2Z-pOt" title="Standrads" alt="standrads" width="300" height="200"   />
                                      </Link>
                                </div>   
                                <div className="col-sm-4 col-md-4  col-lg-4  col-xl-4 col-4"  style={{paddingBottom:"10px",paddingBlockStart:"1px"}} >
                                    <Link to={`${match.url}/tshirt`}  className="hovereffect">
                                        <img src="data:image/jpeg;base64," title="TShirts" alt="Tshirts" width="300" height="200"   />
                                    </Link>
                                </div>   
                                <div className="col-sm-4 col-md-4  col-lg-4  col-xl-4 col-4"  style={{paddingBottom:"10px",paddingBlockStart:"1px"}} >
                                     <Link to={`${match.url}/trousers`}  className="hovereffect">
                                        <img src="https://cdn.shopify.com/s/files/1/1246/4177/products/IX9-Militar-Tactical-Cargo-Pants-Men-Combat-SWAT-Army-Military-Pants-Sweatpants-Man-Trousers.jpg?v=1525249035" title="Trousers" alt="Trousers" width="300" height="200"   />
                                    </Link>
                                </div>   
                                <div className="col-sm-4 col-md-4  col-lg-4  col-xl-4 col-4"  style={{paddingBottom:"10px",paddingBlockStart:"1px"}} >
                                    <Link to={`${match.url}/sleepwear`} className="hovereffect">
                                        <img src="data:image/jpeg;base64," title="sleepwear" alt="sleepwear" width="300" height="200"   />
                                    </Link>
                                </div>   
                                <div className="col-sm-4 col-md-4  col-lg-4  col-xl-4 col-4"  style={{paddingBottom:"10px",paddingBlockStart:"1px"}} >
                                    <Link to={`${match.url}/sandals`}  className="hovereffect">
                                           <img src="http://cdn.shopify.com/s/files/1/2166/3733/products/product-image-281552531_1200x1200.jpg?v=1517084528" title="Sandals" alt="Sandals" width="300" height="200"   />
                                    </Link>
                                </div>   
                                <div className="col-sm-4 col-md-4  col-lg-4  col-xl-4 col-4"  style={{paddingBottom:"10px",paddingBlockStart:"1px"}} >
                                     <Link to={`${match.url}/loafers`} className="hovereffect" >    
                                        <img src="https://m.media-amazon.com/images/S/aplus-seller-content-images-us-east-1/ATVPDKIKX0DER/A6BRE0HD1NAMI/e82bfcaa-1a4e-48af-8416-a463fd133dbf._CR0,0,970,600_PT0_SX970__.jpg" title="loafers" alt="loafers" width="300" height="200"    />
                                    </Link>
                                </div>
                                 <div className="col-sm-4 col-md-4  col-lg-4  col-xl-4 col-4"  style={{paddingBottom:"10px",paddingBlockStart:"1px"}} >
                                     <Link to={`${match.url}/jackets`}  className="hovereffect">    
                                        <img src="data:image/jpeg;base64," title="loafers" alt="loafers" width="300" height="200"    />
                                    </Link>
                                </div>    

                            </div>

